import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class RecommendationsRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="movieResults">
				<div className="title">{this.prop.title}</div>
				<div className="id">{this.prop.id}</div>
				<div className="rating">{this.prop.rating}</div>
				<div className="votes">{this.prop.votes}</div>
			</div>
		);
	}
}
